import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar'; // Navbar'ı import ettik
import ProductList from './components/ProductList';
import Home from './components/Home';
import About from './components/About';
import Contact from './components/Contact';
import MerchantList from './components/MerchantList'; // Satıcı Listesi Bileşeni
import AddMerchant from './components/AddMerchant'; // Satıcı Ekleme Bileşeni
import UserList from './components/UserList'; // Kullanıcı Listesi Bileşeni
import AddUser from './components/AddUser'; // Kullanıcı Ekleme Bileşeni

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar /> {/* Navbar bileşenini ekliyoruz */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/products" element={<ProductList />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />

          {/* Satıcı Yönetimi */}
          <Route path="/merchants" element={<MerchantList />} />  {/* Satıcılar Listesi */}
          <Route path="/add-merchant" element={<AddMerchant />} /> {/* Yeni Satıcı Ekle */}

          {/* Kullanıcı Yönetimi */}
          <Route path="/users" element={<UserList />} />  {/* Kullanıcılar Listesi */}
          <Route path="/add-user" element={<AddUser />} />  {/* Yeni Kullanıcı Ekle */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
